import React, { useState } from 'react';
import { 
  Home, 
  Briefcase, 
  Building, 
  FileText, 
  Users, 
  DollarSign, 
  Wrench, 
  BarChart3,
  ChevronDown,
  Search,
  User,
  ExternalLink
} from 'lucide-react';

const Sidebar = ({ activeTab, setActiveTab }) => {
  const [expandedSections, setExpandedSections] = useState({
    property: false,
    marketing: true,
    screening: false,
    leases: false,
    accounting: false,
    contacts: false,
    maintenance: false
  });

  const toggleSection = (section) => {
    setExpandedSections(prev => ({
      ...prev,
      [section]: !prev[section]
    }));
  };

  const navigationItems = [
    { id: 'dashboard', label: 'Dashboard', icon: Home, hasSubItems: false },
    { id: 'portfolios', label: 'Portfolios', icon: Briefcase, hasSubItems: false },
    { id: 'example-site', label: 'Example Site', icon: ExternalLink, hasSubItems: false, isExternal: true },
    { 
      id: 'property', 
      label: 'Property', 
      icon: Building, 
      hasSubItems: true,
      subItems: [
        { id: 'properties', label: 'Properties' },
        { id: 'associations', label: 'Associations' }
      ]
    },
    { 
      id: 'marketing', 
      label: 'Marketing', 
      icon: Building, 
      hasSubItems: true,
      subItems: [
        { id: 'listings', label: 'Listings' },
        { id: 'lead-to-lease', label: 'Lead to Lease' },
        { id: 'campaigns', label: 'Dashboard' },
        { id: 'analytics', label: 'Analytics' },
        { id: 'automations', label: 'Automations' },
        { id: 'settings', label: 'Settings' }
      ]
    },
    { id: 'screening', label: 'Screening', icon: FileText, hasSubItems: true },
    { id: 'leases', label: 'Leases', icon: FileText, hasSubItems: true },
    { id: 'rentsign', label: 'Rentsign', icon: FileText, hasSubItems: false },
    { id: 'accounting', label: 'Accounting', icon: DollarSign, hasSubItems: true },
    { id: 'contacts', label: 'Contacts', icon: Users, hasSubItems: true },
    { id: 'maintenance', label: 'Maintenance', icon: Wrench, hasSubItems: true },
    { id: 'reports', label: 'Reports', icon: BarChart3, hasSubItems: false }
  ];

  const handleItemClick = (itemId) => {
    if (itemId === 'property' || itemId === 'marketing' || itemId === 'screening' || itemId === 'leases' || 
        itemId === 'accounting' || itemId === 'contacts' || itemId === 'maintenance') {
      toggleSection(itemId);
    } else if (itemId === 'example-site') {
      // Open the standalone example site in a new tab
      window.open('/standalone-example.html', '_blank');
    } else {
      setActiveTab(itemId);
    }
  };

  const handleSubItemClick = (subItemId) => {
    setActiveTab(subItemId);
  };

  return (
    <div className="sidebar">
      {/* Active Pod Selector */}
      <div className="sidebar-section">
        <label className="sidebar-label">Active Pod</label>
        <div className="pod-selector">
          <Search size={16} />
          <span>All pods</span>
          <ChevronDown size={16} />
        </div>
      </div>

      {/* Navigation Menu */}
      <nav className="sidebar-nav">
        {navigationItems.map(item => {
          const Icon = item.icon;
          const isExpanded = expandedSections[item.id];
          const isActive = activeTab === item.id || (item.subItems && item.subItems.some(sub => activeTab === sub.id));

          return (
            <div key={item.id} className="nav-section">
              <div 
                className={`nav-item ${isActive ? 'active' : ''} ${item.isExternal ? 'external' : ''}`}
                onClick={() => handleItemClick(item.id)}
              >
                <Icon size={18} />
                <span>{item.label}</span>
                {item.hasSubItems && (
                  <ChevronDown 
                    size={16} 
                    className={`chevron ${isExpanded ? 'expanded' : ''}`}
                  />
                )}
              </div>

              {item.hasSubItems && item.subItems && isExpanded && (
                <div className="sub-items">
                  {item.subItems.map(subItem => (
                    <div
                      key={subItem.id}
                      className={`sub-item ${activeTab === subItem.id ? 'active' : ''}`}
                      onClick={() => handleSubItemClick(subItem.id)}
                    >
                      {subItem.label}
                    </div>
                  ))}
                </div>
              )}
            </div>
          );
        })}
      </nav>

      {/* Bottom Section */}
      <div className="sidebar-bottom">
        <div className="organization-info">
          <div className="org-name">ABC Homes</div>
          <div className="org-env">QA</div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
